    def test_dpll(self):
        """
        Testiranje dpll.
        """
        f1 = And([V("X"), V("Y")])
        f2 = Not(Or([And([Or([V("p"), V("q")]), Or([V("p"), V("r")])]), And([Not(V("a")), V("b"), V('c')])]))
        f3 = And([V("X"), Not(V("X"))])
        f4 = Not(XOR(V("X"), V("Y")))
        f5 = Not(And([V("X"), V("Y")]))

        # Robni primeri DPLL.
        self.assertEqual(dpll(V("X")), {"X": "Tru"})
        self.assertEqual(dpll(Not(V("X"))), {"X": "Fls"})
        self.assertEqual(dpll(Fls()), False)
        self.assertEqual(dpll(Tru()), True)

        self.assertEqual(dpll(f1), {"X": "Tru", "Y": "Tru"})
        self.assertEqual(dpll(f2), {'a': "Tru", 'c': "Tru", 'b': "Tru", 'q': "Tru", 'p': "Fls", 'r': "Fls"})
        self.assertEqual(dpll(f3), False)
        self.assertEqual(dpll(f4), {'Y': "Tru", 'X': "Tru"})
        self.assertEqual(dpll(f5), {'Y': "Fls", 'X': "Fls"})

        self.assertEqual(dpll(hadamard_simplifed(2)),{'a2,1': "Tru", 'a1,2': "Tru", 'a2,2': "Tru", 'a1,1': "Fls"})

    def test_push_not(self):
        """
        Testiranje potiskanja negacije navznoter.
        """
        f0 = And([V("X"), V("Y")])
        f1 = Not(And([V("X"), V("Y")]))
        f2 = Not(Or([V("X"), V("Y")]))
        f3 = Imp(V("X"), V("Y"))
        f4 = Equiv(V("X"), V("Y"))
        f5 = XOR(V("X"), V("Y"))

        self.assertEqual(simplify_not(f0), f0)
        self.assertEqual(simplify_not(f1), Or([Not(V("X")), Not(V("Y"))]))
        self.assertEqual(simplify_not(f2), And([Not(V("X")), Not(V("Y"))]))
        self.assertEqual(simplify_not(Not(f3)), And([V("X"), Not(V("Y"))]))
        self.assertEqual(simplify_not(Not(f4)), Or([And([V("X"), Not(V("Y"))]), And([Not(V("X")), V("Y")])]))
        self.assertEqual(simplify_not(Not(f5)), Or([And([V("X"), V("Y")]), And([Not(V("X")), Not(V("Y"))])]))

